  // What is this library?  // > CustomCode.MoodleDataAnalyticsLibrary:1
  // This is Moodle Data Analytics Library, created to record interactions with the EJSS simulation that is sent to  // > CustomCode.MoodleDataAnalyticsLibrary:2
  // Moodle server for data analytics purposes. The new implementation is just a wrapper class around the previous   // > CustomCode.MoodleDataAnalyticsLibrary:3
  // set of custom functions written to interact with Moodle.  // > CustomCode.MoodleDataAnalyticsLibrary:4
  // Why this class was created as an upgrade to the previous version of the library.  // > CustomCode.MoodleDataAnalyticsLibrary:5
  // Benefits:  // > CustomCode.MoodleDataAnalyticsLibrary:6
  // 1. Reduce global namespace pollution  // > CustomCode.MoodleDataAnalyticsLibrary:7
  // 2. Code is more understandable,   // > CustomCode.MoodleDataAnalyticsLibrary:8
  //    e.g.   // > CustomCode.MoodleDataAnalyticsLibrary:9
  //    moodle.startQuestion('...') provides context to the developer that startQuestion function/method  // > CustomCode.MoodleDataAnalyticsLibrary:10
  //    belongs to the moodle library that is meant for analytics as opposed to being a custom function  // > CustomCode.MoodleDataAnalyticsLibrary:11
  // How to use this Moodle Analytics library.  // > CustomCode.MoodleDataAnalyticsLibrary:12
  // At the bottom of this script, an instance of the MoodleDataAnalyticsLibrary class is created.  // > CustomCode.MoodleDataAnalyticsLibrary:13
  // use ONLY that instance everywhere in EJSS where you wish to interact with moodle analytics.  // > CustomCode.MoodleDataAnalyticsLibrary:14
  // DO NOT create your own instance and use it.  // > CustomCode.MoodleDataAnalyticsLibrary:15
  // E.g. in another Custom tab, if you wish to record a score to a question, just write code like so..  // > CustomCode.MoodleDataAnalyticsLibrary:16
  // moodle.startQuestion('Q'+index);  // > CustomCode.MoodleDataAnalyticsLibrary:17
  // moodle.addQuestionHistory(userSelection);  // > CustomCode.MoodleDataAnalyticsLibrary:18
  // moodle.awardQuestionMarks(questionPointsScored);  // > CustomCode.MoodleDataAnalyticsLibrary:19
  // moodle.endQuestion();  // > CustomCode.MoodleDataAnalyticsLibrary:20
  class MoodleDataAnalyticsLibrary {  // > CustomCode.MoodleDataAnalyticsLibrary:21
    constructor() {  // > CustomCode.MoodleDataAnalyticsLibrary:22
      this.debugMode = true;  // > CustomCode.MoodleDataAnalyticsLibrary:23
      this._nullFunction = this.debugMode ? console.log : function(){};  // > CustomCode.MoodleDataAnalyticsLibrary:24
      this._questionLib = {  // > CustomCode.MoodleDataAnalyticsLibrary:25
        stack: [],  // > CustomCode.MoodleDataAnalyticsLibrary:26
        history: Object.create(null),  // > CustomCode.MoodleDataAnalyticsLibrary:27
        questionMarksAwarded: Object.create(null)  // > CustomCode.MoodleDataAnalyticsLibrary:28
      };  // > CustomCode.MoodleDataAnalyticsLibrary:29
    }  // > CustomCode.MoodleDataAnalyticsLibrary:30
      // > CustomCode.MoodleDataAnalyticsLibrary:31
    _debugPrint(msg) {  // > CustomCode.MoodleDataAnalyticsLibrary:32
      if (this.debugMode) {  // > CustomCode.MoodleDataAnalyticsLibrary:33
        console.log(msg);  // > CustomCode.MoodleDataAnalyticsLibrary:34
      }  // > CustomCode.MoodleDataAnalyticsLibrary:35
    }  // > CustomCode.MoodleDataAnalyticsLibrary:36
      // > CustomCode.MoodleDataAnalyticsLibrary:37
    _getCurrentQuestion() {  // > CustomCode.MoodleDataAnalyticsLibrary:38
      if (!this.isQuestionStarted()) {  // > CustomCode.MoodleDataAnalyticsLibrary:39
        return null;  // > CustomCode.MoodleDataAnalyticsLibrary:40
      }  // > CustomCode.MoodleDataAnalyticsLibrary:41
      return this._questionLib.stack[this._questionLib.stack.length - 1];  // > CustomCode.MoodleDataAnalyticsLibrary:42
    }  // > CustomCode.MoodleDataAnalyticsLibrary:43
      // > CustomCode.MoodleDataAnalyticsLibrary:44
    isQuestionStarted() {  // > CustomCode.MoodleDataAnalyticsLibrary:45
      /*  // > CustomCode.MoodleDataAnalyticsLibrary:46
       * Use this function to determine whether a question is pending (has started but has not ended).  // > CustomCode.MoodleDataAnalyticsLibrary:47
       *   // > CustomCode.MoodleDataAnalyticsLibrary:48
       * No Parameters  // > CustomCode.MoodleDataAnalyticsLibrary:49
       *  // > CustomCode.MoodleDataAnalyticsLibrary:50
       * return value:  // > CustomCode.MoodleDataAnalyticsLibrary:51
       * Boolean  // > CustomCode.MoodleDataAnalyticsLibrary:52
       */  // > CustomCode.MoodleDataAnalyticsLibrary:53
      return this._questionLib.stack.length > 0;  // > CustomCode.MoodleDataAnalyticsLibrary:54
    }  // > CustomCode.MoodleDataAnalyticsLibrary:55
      // > CustomCode.MoodleDataAnalyticsLibrary:56
    startQuestion(questionName) {  // > CustomCode.MoodleDataAnalyticsLibrary:57
      /*  // > CustomCode.MoodleDataAnalyticsLibrary:58
       * This function should be called whenever the student first sees the question,   // > CustomCode.MoodleDataAnalyticsLibrary:59
       * and the student cannot start answering any other question. The question may be subsequently   // > CustomCode.MoodleDataAnalyticsLibrary:60
       * ended by calling endQuestion function.  // > CustomCode.MoodleDataAnalyticsLibrary:61
       *   // > CustomCode.MoodleDataAnalyticsLibrary:62
       * Parameters:  // > CustomCode.MoodleDataAnalyticsLibrary:63
       * questionName: string  // > CustomCode.MoodleDataAnalyticsLibrary:64
       *  // > CustomCode.MoodleDataAnalyticsLibrary:65
       * return value:  // > CustomCode.MoodleDataAnalyticsLibrary:66
       * undefined  // > CustomCode.MoodleDataAnalyticsLibrary:67
       */  // > CustomCode.MoodleDataAnalyticsLibrary:68
      _view._addInteraction(this._nullFunction,   // > CustomCode.MoodleDataAnalyticsLibrary:69
                            {  // > CustomCode.MoodleDataAnalyticsLibrary:70
                              action:"questionStart",   // > CustomCode.MoodleDataAnalyticsLibrary:71
                              name:questionName  // > CustomCode.MoodleDataAnalyticsLibrary:72
                            },  // > CustomCode.MoodleDataAnalyticsLibrary:73
                            {  // > CustomCode.MoodleDataAnalyticsLibrary:74
                              element:"questionLib",   // > CustomCode.MoodleDataAnalyticsLibrary:75
                              property:"value"  // > CustomCode.MoodleDataAnalyticsLibrary:76
                            }  // > CustomCode.MoodleDataAnalyticsLibrary:77
                         );  // > CustomCode.MoodleDataAnalyticsLibrary:78
      this._debugPrint("Start question: " + questionName);  // > CustomCode.MoodleDataAnalyticsLibrary:79
      this._questionLib.stack.push(questionName);  // > CustomCode.MoodleDataAnalyticsLibrary:80
    }  // > CustomCode.MoodleDataAnalyticsLibrary:81
      // > CustomCode.MoodleDataAnalyticsLibrary:82
    endQuestion() {  // > CustomCode.MoodleDataAnalyticsLibrary:83
      /*  // > CustomCode.MoodleDataAnalyticsLibrary:84
       * This function should be called whenever the student submits/finalises their answer for the question.  // > CustomCode.MoodleDataAnalyticsLibrary:85
       *   // > CustomCode.MoodleDataAnalyticsLibrary:86
       * No Parameters  // > CustomCode.MoodleDataAnalyticsLibrary:87
       *  // > CustomCode.MoodleDataAnalyticsLibrary:88
       * return value:  // > CustomCode.MoodleDataAnalyticsLibrary:89
       * undefined  // > CustomCode.MoodleDataAnalyticsLibrary:90
       */  // > CustomCode.MoodleDataAnalyticsLibrary:91
      if (this._questionLib.stack.length > 0) {  // > CustomCode.MoodleDataAnalyticsLibrary:92
        const questionName = this._questionLib.stack.pop();  // > CustomCode.MoodleDataAnalyticsLibrary:93
        this._debugPrint("End question: " + questionName);  // > CustomCode.MoodleDataAnalyticsLibrary:94
        _view._addInteraction(this._nullFunction,   // > CustomCode.MoodleDataAnalyticsLibrary:95
                              {  // > CustomCode.MoodleDataAnalyticsLibrary:96
                                action:"questionEnd",   // > CustomCode.MoodleDataAnalyticsLibrary:97
                                name:questionName  // > CustomCode.MoodleDataAnalyticsLibrary:98
                              },   // > CustomCode.MoodleDataAnalyticsLibrary:99
                              {  // > CustomCode.MoodleDataAnalyticsLibrary:100
                                element: "questionLib",   // > CustomCode.MoodleDataAnalyticsLibrary:101
                                property: "value"  // > CustomCode.MoodleDataAnalyticsLibrary:102
                              }  // > CustomCode.MoodleDataAnalyticsLibrary:103
                            );  // > CustomCode.MoodleDataAnalyticsLibrary:104
      }  // > CustomCode.MoodleDataAnalyticsLibrary:105
    }  // > CustomCode.MoodleDataAnalyticsLibrary:106
      // > CustomCode.MoodleDataAnalyticsLibrary:107
    // for assessment.json history  // > CustomCode.MoodleDataAnalyticsLibrary:108
    addQuestionHistory(history, questionName=null) {  // > CustomCode.MoodleDataAnalyticsLibrary:109
    /*  // > CustomCode.MoodleDataAnalyticsLibrary:110
     * Adds an entry to the question history to the specified question, or to the pending question by default.   // > CustomCode.MoodleDataAnalyticsLibrary:111
     * If adding to the question history of the pending question, it also flushes the history. (which makes Moodle able to read the history)  // > CustomCode.MoodleDataAnalyticsLibrary:112
     *  // > CustomCode.MoodleDataAnalyticsLibrary:113
     * Parameters:  // > CustomCode.MoodleDataAnalyticsLibrary:114
     * history: string, questionName?: string  // > CustomCode.MoodleDataAnalyticsLibrary:115
     *  // > CustomCode.MoodleDataAnalyticsLibrary:116
     * return value:  // > CustomCode.MoodleDataAnalyticsLibrary:117
     * undefined  // > CustomCode.MoodleDataAnalyticsLibrary:118
     *  // > CustomCode.MoodleDataAnalyticsLibrary:119
     * questioName:  // > CustomCode.MoodleDataAnalyticsLibrary:120
     * This is the name of the question that the history will be added to. If this parameter is not set, by default, the history entry  // > CustomCode.MoodleDataAnalyticsLibrary:121
     * will be added to the pending question.  // > CustomCode.MoodleDataAnalyticsLibrary:122
     */  // > CustomCode.MoodleDataAnalyticsLibrary:123
      // > CustomCode.MoodleDataAnalyticsLibrary:124
      if (questionName === null && this.isQuestionStarted()) {  // > CustomCode.MoodleDataAnalyticsLibrary:125
        questionName = this._getCurrentQuestion();  // > CustomCode.MoodleDataAnalyticsLibrary:126
      }  // > CustomCode.MoodleDataAnalyticsLibrary:127
      // > CustomCode.MoodleDataAnalyticsLibrary:128
      if (!(questionName in this._questionLib.history)) {  // > CustomCode.MoodleDataAnalyticsLibrary:129
        this._debugPrint("Create question history for " + questionName);  // > CustomCode.MoodleDataAnalyticsLibrary:130
        this._questionLib.history[questionName] = [];  // > CustomCode.MoodleDataAnalyticsLibrary:131
      }  // > CustomCode.MoodleDataAnalyticsLibrary:132
      if (this.debugMode) {  // > CustomCode.MoodleDataAnalyticsLibrary:133
        console.log("Push \"" + history + "\" to question history for " + questionName);  // > CustomCode.MoodleDataAnalyticsLibrary:134
      }  // > CustomCode.MoodleDataAnalyticsLibrary:135
      this._questionLib.history[questionName].push(history);  // > CustomCode.MoodleDataAnalyticsLibrary:136
      this._flushQuestionHistory(questionName);  // > CustomCode.MoodleDataAnalyticsLibrary:137
      }  // > CustomCode.MoodleDataAnalyticsLibrary:138
        // > CustomCode.MoodleDataAnalyticsLibrary:139
    _flushQuestionHistory(questionName) {  // > CustomCode.MoodleDataAnalyticsLibrary:140
      if (questionName === this._getCurrentQuestion()) {  // > CustomCode.MoodleDataAnalyticsLibrary:141
        const outputHistory = this._getQuestionHistory(questionName);  // > CustomCode.MoodleDataAnalyticsLibrary:142
        _view._addInteraction(this._nullFunction,   // > CustomCode.MoodleDataAnalyticsLibrary:143
                              outputHistory,   // > CustomCode.MoodleDataAnalyticsLibrary:144
                              {  // > CustomCode.MoodleDataAnalyticsLibrary:145
                                property: "historyFor" + questionName,   // > CustomCode.MoodleDataAnalyticsLibrary:146
                                element: "questionLib"  // > CustomCode.MoodleDataAnalyticsLibrary:147
                              }  // > CustomCode.MoodleDataAnalyticsLibrary:148
                             );  // > CustomCode.MoodleDataAnalyticsLibrary:149
      }  // > CustomCode.MoodleDataAnalyticsLibrary:150
    }  // > CustomCode.MoodleDataAnalyticsLibrary:151
      // > CustomCode.MoodleDataAnalyticsLibrary:152
    _getQuestionHistory(questionName) {  // > CustomCode.MoodleDataAnalyticsLibrary:153
      if (questionName in this._questionLib.history) {  // > CustomCode.MoodleDataAnalyticsLibrary:154
        return this._questionLib.history[questionName].join("\n");  // > CustomCode.MoodleDataAnalyticsLibrary:155
      } else {  // > CustomCode.MoodleDataAnalyticsLibrary:156
        _debugPrint("No question \"" + questionName + "\" exists");  // > CustomCode.MoodleDataAnalyticsLibrary:157
        return "";  // > CustomCode.MoodleDataAnalyticsLibrary:158
      }  // > CustomCode.MoodleDataAnalyticsLibrary:159
    }  // > CustomCode.MoodleDataAnalyticsLibrary:160
      // > CustomCode.MoodleDataAnalyticsLibrary:161
    onAnswer(answer, isCorrect=false, history=answer, questionName=null) {  // > CustomCode.MoodleDataAnalyticsLibrary:162
    /*  // > CustomCode.MoodleDataAnalyticsLibrary:163
     * Indicates that the student made an attempt to answer the question,   // > CustomCode.MoodleDataAnalyticsLibrary:164
     * writes the history, and adds a log for the submitted answer.   // > CustomCode.MoodleDataAnalyticsLibrary:165
     * However, it does not give marks in itself (that is done by awardQuestionMarks)  // > CustomCode.MoodleDataAnalyticsLibrary:166
     *   // > CustomCode.MoodleDataAnalyticsLibrary:167
     * Parameters:  // > CustomCode.MoodleDataAnalyticsLibrary:168
     * answer: String  // > CustomCode.MoodleDataAnalyticsLibrary:169
     * A string representing what the student chose as the answer to the question.   // > CustomCode.MoodleDataAnalyticsLibrary:170
     * This can be used in an advanced assessment.json generator to check the answers on the server side.  // > CustomCode.MoodleDataAnalyticsLibrary:171
     *  // > CustomCode.MoodleDataAnalyticsLibrary:172
     * isCorrect?: Boolean   // > CustomCode.MoodleDataAnalyticsLibrary:173
     * Whether the student's answer is correct (defaults to false)  // > CustomCode.MoodleDataAnalyticsLibrary:174
     *  // > CustomCode.MoodleDataAnalyticsLibrary:175
     * history: String   // > CustomCode.MoodleDataAnalyticsLibrary:176
     * A textual representation of what the student chose as the answer to the question.   // > CustomCode.MoodleDataAnalyticsLibrary:177
     * By default, this is the same as the value given in the parameter answer.   // > CustomCode.MoodleDataAnalyticsLibrary:178
     * This parameter controls what the teacher will see when they hover their cursor over the student's marks for this question.  // > CustomCode.MoodleDataAnalyticsLibrary:179
     *  // > CustomCode.MoodleDataAnalyticsLibrary:180
     * questionName?: String   // > CustomCode.MoodleDataAnalyticsLibrary:181
     * The name of the question the student is giving an answer to.   // > CustomCode.MoodleDataAnalyticsLibrary:182
     * By default, this is the pending question.   // > CustomCode.MoodleDataAnalyticsLibrary:183
     * However, this can be overridden using this parameter to write the answer history to some other question.  // > CustomCode.MoodleDataAnalyticsLibrary:184
     */  // > CustomCode.MoodleDataAnalyticsLibrary:185
      if (questionName === null && this.isQuestionStarted()) {  // > CustomCode.MoodleDataAnalyticsLibrary:186
        questionName = this._questionLib.stack[this._questionLib.stack.length - 1];  // > CustomCode.MoodleDataAnalyticsLibrary:187
      }  // > CustomCode.MoodleDataAnalyticsLibrary:188
      // > CustomCode.MoodleDataAnalyticsLibrary:189
      if (questionName !== null) {  // > CustomCode.MoodleDataAnalyticsLibrary:190
        const explainer = Object.create(null);  // > CustomCode.MoodleDataAnalyticsLibrary:191
        explainer[true] = " ✅";  // > CustomCode.MoodleDataAnalyticsLibrary:192
        explainer[false] = " ❌";  // > CustomCode.MoodleDataAnalyticsLibrary:193
        this.addQuestionHistory(history + explainer[isCorrect], questionName);  // > CustomCode.MoodleDataAnalyticsLibrary:194
        if (questionName === this._getCurrentQuestion()) {  // > CustomCode.MoodleDataAnalyticsLibrary:195
          _view._addInteraction(this._nullFunction, {name:questionName, answer:answer, isCorrect:isCorrect, action:"questionAnswer"}, {property: "answer", element:"questionLib"});  // > CustomCode.MoodleDataAnalyticsLibrary:196
        }  // > CustomCode.MoodleDataAnalyticsLibrary:197
      }  // > CustomCode.MoodleDataAnalyticsLibrary:198
    }  // > CustomCode.MoodleDataAnalyticsLibrary:199
      // > CustomCode.MoodleDataAnalyticsLibrary:200
      // > CustomCode.MoodleDataAnalyticsLibrary:201
    awardQuestionMarks(marks=1) {  // > CustomCode.MoodleDataAnalyticsLibrary:202
    /*  // > CustomCode.MoodleDataAnalyticsLibrary:203
     * Awards a number of marks to the student for the pending question.  // > CustomCode.MoodleDataAnalyticsLibrary:204
     *   // > CustomCode.MoodleDataAnalyticsLibrary:205
     * Parameters:  // > CustomCode.MoodleDataAnalyticsLibrary:206
     * marks?: int   // > CustomCode.MoodleDataAnalyticsLibrary:207
     *  // > CustomCode.MoodleDataAnalyticsLibrary:208
     * The number of marks to award to the student. By default, this value is 1.  // > CustomCode.MoodleDataAnalyticsLibrary:209
     */  // > CustomCode.MoodleDataAnalyticsLibrary:210
    if (this.isQuestionStarted()) {  // > CustomCode.MoodleDataAnalyticsLibrary:211
      const questionName = this._getCurrentQuestion();  // > CustomCode.MoodleDataAnalyticsLibrary:212
      this._questionLib.questionMarksAwarded[questionName] = marks;  // > CustomCode.MoodleDataAnalyticsLibrary:213
      _view._addInteraction(  // > CustomCode.MoodleDataAnalyticsLibrary:214
        this._nullFunction,   // > CustomCode.MoodleDataAnalyticsLibrary:215
        this._questionLib.questionMarksAwarded[questionName],   // > CustomCode.MoodleDataAnalyticsLibrary:216
        {  // > CustomCode.MoodleDataAnalyticsLibrary:217
          element: "questionLib",   // > CustomCode.MoodleDataAnalyticsLibrary:218
          property: "awardMarkFor"+questionName  // > CustomCode.MoodleDataAnalyticsLibrary:219
        }  // > CustomCode.MoodleDataAnalyticsLibrary:220
      );  // > CustomCode.MoodleDataAnalyticsLibrary:221
    }  // > CustomCode.MoodleDataAnalyticsLibrary:222
  }  // > CustomCode.MoodleDataAnalyticsLibrary:223
      // > CustomCode.MoodleDataAnalyticsLibrary:224
    resetQuestionMarks(questionName) {  // > CustomCode.MoodleDataAnalyticsLibrary:225
    /*  // > CustomCode.MoodleDataAnalyticsLibrary:226
     * Reset the awarded marks for the indicated question to 0 the next time the question is started.  // > CustomCode.MoodleDataAnalyticsLibrary:227
     *   // > CustomCode.MoodleDataAnalyticsLibrary:228
     * Parameters:   // > CustomCode.MoodleDataAnalyticsLibrary:229
     * questionName: string  // > CustomCode.MoodleDataAnalyticsLibrary:230
     *  // > CustomCode.MoodleDataAnalyticsLibrary:231
     * return value:   // > CustomCode.MoodleDataAnalyticsLibrary:232
     * undefined  // > CustomCode.MoodleDataAnalyticsLibrary:233
     *  // > CustomCode.MoodleDataAnalyticsLibrary:234
     * questionName:  // > CustomCode.MoodleDataAnalyticsLibrary:235
     * The name of the question to reset.  // > CustomCode.MoodleDataAnalyticsLibrary:236
     */  // > CustomCode.MoodleDataAnalyticsLibrary:237
      this._questionLib.questionMarksAwarded[questionName] = 0;  // > CustomCode.MoodleDataAnalyticsLibrary:238
    }  // > CustomCode.MoodleDataAnalyticsLibrary:239
    questionInstantMark(questionName, message) {  // > CustomCode.MoodleDataAnalyticsLibrary:240
    /*  // > CustomCode.MoodleDataAnalyticsLibrary:241
     * A convenience function to start a question, award a mark, (optionally) add a history entry, and end the question.  // > CustomCode.MoodleDataAnalyticsLibrary:242
     * This function should be called whenever a student answers a question correctly.  // > CustomCode.MoodleDataAnalyticsLibrary:243
     * It instantly submits the correct answer to the Moodle server, and gives the student a mark.   // > CustomCode.MoodleDataAnalyticsLibrary:244
     * For most cases, this function would suffice.  // > CustomCode.MoodleDataAnalyticsLibrary:245
     *   // > CustomCode.MoodleDataAnalyticsLibrary:246
     * Parameters:   // > CustomCode.MoodleDataAnalyticsLibrary:247
     * questionName: string, message?: string  // > CustomCode.MoodleDataAnalyticsLibrary:248
     *  // > CustomCode.MoodleDataAnalyticsLibrary:249
     * return value:   // > CustomCode.MoodleDataAnalyticsLibrary:250
     * undefined  // > CustomCode.MoodleDataAnalyticsLibrary:251
     *  // > CustomCode.MoodleDataAnalyticsLibrary:252
     * questionName:  // > CustomCode.MoodleDataAnalyticsLibrary:253
     * These values are the names of the questions that will be displayed on the analytics page on Moodle,   // > CustomCode.MoodleDataAnalyticsLibrary:254
     * and they'll be needed when you make the assessment.json file so please remember to note down what   // > CustomCode.MoodleDataAnalyticsLibrary:255
     * values you use for the name of each question.  // > CustomCode.MoodleDataAnalyticsLibrary:256
     *   // > CustomCode.MoodleDataAnalyticsLibrary:257
     * message:   // > CustomCode.MoodleDataAnalyticsLibrary:258
     * What Moodle will display when the teacher hovers their mouse over the student's mark for a particular question.  // > CustomCode.MoodleDataAnalyticsLibrary:259
     */  // > CustomCode.MoodleDataAnalyticsLibrary:260
    this.startQuestion(questionName);  // > CustomCode.MoodleDataAnalyticsLibrary:261
    this._debugPrint("" + message);  // > CustomCode.MoodleDataAnalyticsLibrary:262
    if (message) {  // > CustomCode.MoodleDataAnalyticsLibrary:263
      this.addQuestionHistory(message);  // > CustomCode.MoodleDataAnalyticsLibrary:264
    } else {  // > CustomCode.MoodleDataAnalyticsLibrary:265
      this._flushQuestionHistory(questionName);  // > CustomCode.MoodleDataAnalyticsLibrary:266
    }  // > CustomCode.MoodleDataAnalyticsLibrary:267
    this.awardQuestionMarks();  // > CustomCode.MoodleDataAnalyticsLibrary:268
    this.endQuestion();  // > CustomCode.MoodleDataAnalyticsLibrary:269
  }  // > CustomCode.MoodleDataAnalyticsLibrary:270
    questionAppendHistory(questionName, message) {  // > CustomCode.MoodleDataAnalyticsLibrary:271
    /*  // > CustomCode.MoodleDataAnalyticsLibrary:272
     * Adds a history entry to the given question.  // > CustomCode.MoodleDataAnalyticsLibrary:273
     *   // > CustomCode.MoodleDataAnalyticsLibrary:274
     * Parameters:   // > CustomCode.MoodleDataAnalyticsLibrary:275
     * questionName: string, message?: string  // > CustomCode.MoodleDataAnalyticsLibrary:276
     *  // > CustomCode.MoodleDataAnalyticsLibrary:277
     * return value:   // > CustomCode.MoodleDataAnalyticsLibrary:278
     * undefined  // > CustomCode.MoodleDataAnalyticsLibrary:279
     *  // > CustomCode.MoodleDataAnalyticsLibrary:280
     * questionName:  // > CustomCode.MoodleDataAnalyticsLibrary:281
     * The name of the question to append the history entry to.  // > CustomCode.MoodleDataAnalyticsLibrary:282
     *   // > CustomCode.MoodleDataAnalyticsLibrary:283
     * message:  // > CustomCode.MoodleDataAnalyticsLibrary:284
     * The history entry to add to the question.  // > CustomCode.MoodleDataAnalyticsLibrary:285
     */  // > CustomCode.MoodleDataAnalyticsLibrary:286
    if (!(questionName in this._questionLib.questionMarksAwarded)) {  // > CustomCode.MoodleDataAnalyticsLibrary:287
      this._questionLib.questionMarksAwarded[questionName] = 0;  // > CustomCode.MoodleDataAnalyticsLibrary:288
    }  // > CustomCode.MoodleDataAnalyticsLibrary:289
    let shouldPushQuestion = this._getCurrentQuestion() !== questionName;  // > CustomCode.MoodleDataAnalyticsLibrary:290
    if (shouldPushQuestion) {  // > CustomCode.MoodleDataAnalyticsLibrary:291
      this.startQuestion(questionName);  // > CustomCode.MoodleDataAnalyticsLibrary:292
    }  // > CustomCode.MoodleDataAnalyticsLibrary:293
    this.awardQuestionMarks(this._questionLib.questionMarksAwarded[questionName])  // > CustomCode.MoodleDataAnalyticsLibrary:294
    this.addQuestionHistory(message);  // > CustomCode.MoodleDataAnalyticsLibrary:295
    if (shouldPushQuestion) {  // > CustomCode.MoodleDataAnalyticsLibrary:296
      this.endQuestion();  // > CustomCode.MoodleDataAnalyticsLibrary:297
    }  // > CustomCode.MoodleDataAnalyticsLibrary:298
  }  // > CustomCode.MoodleDataAnalyticsLibrary:299
    resetQuestionHistory(questionName) {  // > CustomCode.MoodleDataAnalyticsLibrary:300
    /*  // > CustomCode.MoodleDataAnalyticsLibrary:301
     * Clear/reset the history of the indicated question.  // > CustomCode.MoodleDataAnalyticsLibrary:302
     *   // > CustomCode.MoodleDataAnalyticsLibrary:303
     * Parameters:   // > CustomCode.MoodleDataAnalyticsLibrary:304
     * questionName: string  // > CustomCode.MoodleDataAnalyticsLibrary:305
     *  // > CustomCode.MoodleDataAnalyticsLibrary:306
     * return value:   // > CustomCode.MoodleDataAnalyticsLibrary:307
     * undefined  // > CustomCode.MoodleDataAnalyticsLibrary:308
     *  // > CustomCode.MoodleDataAnalyticsLibrary:309
     * questionName:  // > CustomCode.MoodleDataAnalyticsLibrary:310
     * The name of the question to reset.  // > CustomCode.MoodleDataAnalyticsLibrary:311
     */    // > CustomCode.MoodleDataAnalyticsLibrary:312
      this._questionLib.history[questionName] = [];  // > CustomCode.MoodleDataAnalyticsLibrary:313
    }  // > CustomCode.MoodleDataAnalyticsLibrary:314
    resetQuestion(questionName) {  // > CustomCode.MoodleDataAnalyticsLibrary:315
    /*  // > CustomCode.MoodleDataAnalyticsLibrary:316
     * A convenience function to reset the marks and history of an indicated question.  // > CustomCode.MoodleDataAnalyticsLibrary:317
     */    // > CustomCode.MoodleDataAnalyticsLibrary:318
      this.resetQuestionHistory(questionName);  // > CustomCode.MoodleDataAnalyticsLibrary:319
      this.resetQuestionMarks(questionName);  // > CustomCode.MoodleDataAnalyticsLibrary:320
    }  // > CustomCode.MoodleDataAnalyticsLibrary:321
  }  // > CustomCode.MoodleDataAnalyticsLibrary:322
